import React, { Fragment } from 'react';
import { connect } from 'react-redux';
import {Link} from 'react-router-dom';
import StarRating from './starrating.jsx';
import '../cartstyles.css';

function CSupport() {
    return (
        <div>
            <div class = "feedback-title">
                FEEDBACK
            </div>
            <div class = "feedback-form">
                <div class = "subject-title">
                    <h3><strong>SUBJECT</strong></h3>
                </div>
                <form action="/action_page.php">
                    <input type="text" name ="subject" placeholder="   Write your text here"/>
                </form>
                <div class = "message-title">
                    <h3><strong>MESSAGE</strong></h3>
                </div>
                <textarea class = "message-area" placeholder="   Write your text here"></textarea>
                <br/> <br/>
                <StarRating/>
                <div class = "confirm">
                        <button type="button" class="btn btn-success btn-lg">SUBMIT</button>
                </div>
                <br/>
            </div>
        </div>
    )
}

export default CSupport;
